import React, { Component } from 'react';
import getPokemonData from '../data/DataPokemons';
import Headline from './Headline';
console.log('cheguei no arquivo card');
class PokemonCard extends Component {
  render() {
    console.log('cheguei no card');
    const { name, image, type, weight } = this.props;
    return(
      <div className="card-pokemon">
        <img src={image} alt={`Pokemon - ${name}`} />
        <Headline type="subtitle3" text={name} />
        <p>{type}</p>
        <p>Average Weight: {weight}</p>
      </div>
    )
  }
}

export default PokemonCard;
